import PeopleAltIcon from '@mui/icons-material/PeopleAlt';
import MailOutlineIcon from '@mui/icons-material/MailOutline';
import FaceIcon from '@mui/icons-material/Face';


function Header() {
    return (
        <div>
        <h2>I am a header</h2>
        <PeopleAltIcon />
        <MailOutlineIcon />
        <FaceIcon />


        </div>
    )
}

export default Header
